import React from "react";
import "./Sidebar.css";
import {useSelector} from "react-redux"; 

function Sidebar() {
    const sidebar = useSelector((state) => state.sidebar);
    //from index

    return (
        <div className="sidebar">
            <ul className="sidebar__links">
                <li className="sidebar__link">
                    Home
                </li>
                <li className="sidebar__link">
                    About
                </li>
                <li className="sidebar__link">
                    Blogs
                </li>
                <li className="sidebar__link">
                    FAQs
                </li>
                <li className="sidebar__link">
                    Community
                </li>
                <li className="sidebar__link">
                    Contact
                </li>
            </ul>
            
        </div>
    )
}

export default Sidebar;
